import { GridList } from "@material-ui/core";
import { Component } from "react";
import Item from "../../components/cart-item/Item";

const tileData = ['test', 'test2', 'test', 'test2'
];

class Home extends Component {

    render() {
        return (
            <GridList cols={3}>
                {
                    tileData.map(data =>
                        <ul>
                            <Item cart={data}></Item>
                        </ul>
                    )
                }
            </GridList>
        );
    }
}

export default Home;
